import React, { useContext } from 'react'
import AdminNavbar from '../Admin/AdminNavbar'
import { Outlet } from 'react-router-dom'
import { useSelector } from 'react-redux'
import CreateRestaurant from '../Admin/AddRestaurants/CreateRestaurant';
import { SideBarContext } from '../State/Store/SideBarContext/SideBarContext';

export default function AdminLayout() {
    const { restaurant } = useSelector(store => store);
    const {handleCloseSideBar}=     useContext(SideBarContext);

    return (
        <>
            <AdminNavbar />
            <main>
                {!restaurant?.usersRestaurant ? <Outlet /> : <CreateRestaurant />}
            </main>
        </>)
}
